import React, { useState, useEffect } from "react";
import axios from "axios";


const Orders = () => {

  const [allOrders, setAllOrders] = useState([]);

  useEffect(() => {
    axios.get("https://zerodha-clone-backend-z8u8.onrender.com/newOrder")
      .then((res) => {
        setAllOrders(res.data, 2000);
      })
      .catch((err) => console.error("Error fetching orders:", err));
  
    return () => {
      console.log("Cleanup function running"); // Make sure this is valid
    };
  }, []);
  
  
  return (
    <div className="order-table">
      <table>
        <tr>
          <th>name</th>
          <th>qty</th>  
          <th>price</th>
        </tr>
        {allOrders.map( (order, index) => {
            return (
              <tr key={index}>
                <td>{order.name}</td>
                <td>{order.qty}</td>
                <td>{order.price}</td>
              </tr>
            );
          })}

      </table>
    </div>
  );
};

export default Orders;
